import React from "react";
import { reduxForm, Field } from "redux-form";
import { Input, Form } from "antd";

let LoginForm = () => {
  // console.log("govno");

  return (
    <>
      <Form>
        <div>
          <label> Name </label>
          <Field name="firstName" component={Input} />
        </div>
      </Form>
      <hr />
    </>
  );
};

LoginForm = reduxForm({
  form: "login"
})(LoginForm);

export default LoginForm;
